import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product grid to be populated by the script
    await page.waitForSelector('.products-grid .product-card', { timeout: 5000 });

    // Take a screenshot of the products section for verification
    const productsSection = await page.locator('//h2[text()="Featured Products"]/..');
    await productsSection.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));

    // Locate all product price elements within product cards
    const priceLocators = page.locator('.product-card .product-price');
    const pricesText = await priceLocators.allInnerTexts();

    // Clean the extracted text to get only the current price value
    const extractedPrices = pricesText.map(price => {
      // The text can be in the format "$123.45\n$150.00" or just "$123.45"
      // We take the first line which represents the current price.
      return price.split('\n')[0].trim();
    });

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: extractedPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
